import React from 'react';
import Nav from "./components/Nav/Index";
import Home from "./pages/Home";
import Projects from "./pages/Projects";
import Skills from "./pages/Skills";

function App(props) {
  return (
    <div>
      <Nav />
      <Home />
      <Projects />
      <Skills />
    </div>
  );
}

export default App;
